const Header = () => {
  return (
    <header className="bg-gradient-to-r from-emerald-500 to-blue-950 py-6 px-4 shadow-lg">
      <div className="max-w-5xl mx-auto flex justify-between items-center">
        {/* Contenedor para el logo de Kushki, el logo de IntelliPrompt y el título */}
        <div className="flex items-center gap-2"> {/* Reducimos el gap para que estén más juntos */}
          {/* Logo de Kushki */}
          {/* Asegúrate que la ruta sea correcta. Si KUSHKI.png está en public/, usa src="KUSHKI.png" */}
          <img src="KUSHKI.png" alt="Logo de Kushki" className="h-20" />

          {/* Logo de IntelliPrompt (tu logo) */}
          {/* Asegúrate que la ruta sea correcta. Si logoIntelliPrompt.png está en public/, usa src="logoIntelliPrompt.png" */}
          <img src="logoIntelliPrompt.png" alt="Logo de IntelliPrompt" className="h-20" />

          {/* Título IntelliPrompt */}
          {/* Eliminamos el text-white aquí si queremos que el título esté en el color del texto */}
          {/* Si quieres que se vea como en Kushki que el texto 'SOMOS La Paytech...' es blanco, mantenlo como text-white */}
          <h1 className="text-2xl font-bold text-white ml-2">IntelliPrompt</h1> {/* Añadimos ml-2 para separarlo un poco de los logos */}
        </div>

        {/* Texto de la descripción, ahora a la derecha */}
        <div className="text-white opacity-90">
          Crea un prompt y envíalo a la IA de tu preferencia
        </div>
      </div>
    </header>
  );
};

export default Header;
